import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { BaseLayoutComponent } from './layouts/base-layout/base-layout.component';
import { ContextLayoutComponent } from './layouts/context-layout/context-layout.component';
import { AppRoutingModule } from '../app-routing.module';
import { InternshipListingComponent } from '../features/internship-management/internship-listing/internship-listing.component';



@NgModule({
  declarations: [
    BaseLayoutComponent,
    ContextLayoutComponent
  ],
  imports: [
    CommonModule,
    AppRoutingModule,
    InternshipListingComponent
  ]
})
export class SharedModule { }
